            { Université: "Université Chouaib Doukkali – El jadida", Site_web: "www.ucd.ac.ma" },

            { Université: "Université Ibn Tofail – Kénitra", Site_web: "www.uit.ac.ma" },

            { Université: "Université Ibn Zohr - Agadir", Site_web: "www.uiz.ac.ma" },

            { Université: "Université Hassan Premier - Settat", Site_web: "www.uh1.ac.ma" },

            { Université: "Université Sultan Moulay Slimane – Béni Mellal", Site_web: "www.usms.ac.ma" }
        ]
    },

    reducers: {
    }
})
export const { filterlist, thisit } = ListSlice.actions
export default ListSlice.reducer
